import React, { useState } from "react";
import "./styles.css";

import Path from "path";

const way = Path.resolve(__dirname, "..", "..", "assets", "button");

export default function button() {
  const [image, setImage] = useState([
    { id: 1, icon: `${icon}/order.svg` },
    { id: 2, icon: `${icon}/menu.svg` },
    { id: 3, icon: `${icon}/prato.svg` },
    { id: 4, icon: `${icon}/ingredients.svg` }
  ]);
  return <button key={image.id}>{image.icon}</button>;
}
